  return(
    <div>
      <main>
        <h1>MY GALLERY</h1>
        <section className="artwork">
            {artworkList && artworkList.length && artwork.map((artwork) => {
                return (
                  <div key={artwork.id} >
                    <img src={artwork.poster} alt={artwork.title} 
                    onClick={() => history.push(`/details/${artwork.id}`)}/>
                    <h3>{artwork.title}</h3>
                    <button id="deleteBtn" onClick={handleDelete}>
                      Delete
                    </button>
                  </div>
                );
            })}
        </section>
      </main>
    </div>
    );
}

export default LikesGalleryPage;
